You can achieve this by utilizing `ThreadLocal` in Java. This approach allows you to store context-specific information (like language) that is tied to the current thread. When a REST request comes in, you can set the language as a `ThreadLocal` variable, and it will be accessible to all beans and services that are executed within the context of that request.

Here's a step-by-step example of how you can implement this:

1. **Create a `ThreadLocal` Holder for the Language:**

   ```java
   public class LanguageContextHolder {
       private static final ThreadLocal<String> languageHolder = new ThreadLocal<>();

       public static void setLanguage(String language) {
           languageHolder.set(language);
       }

       public static String getLanguage() {
           return languageHolder.get();
       }

       public static void clear() {
           languageHolder.remove();
       }
   }
   ```

2. **Set the Language in a Filter or Interceptor:**

   You can create a filter or interceptor to set the language based on the incoming request.

   Example using a Spring `HandlerInterceptor`:

   ```java
   import jakarta.servlet.http.HttpServletRequest;
   import jakarta.servlet.http.HttpServletResponse;
   import org.springframework.web.servlet.HandlerInterceptor;

   public class LanguageInterceptor implements HandlerInterceptor {
       @Override
       public boolean preHandle(HttpServletRequest request, HttpServletResponse response, Object handler) throws Exception {
           String language = request.getHeader("Accept-Language"); // or any other logic to determine language
           LanguageContextHolder.setLanguage(language);
           return true;
       }

       @Override
       public void afterCompletion(HttpServletRequest request, HttpServletResponse response, Object handler, Exception ex) throws Exception {
           LanguageContextHolder.clear(); // Clean up the ThreadLocal
       }
   }
   ```

3. **Register the Interceptor:**

   Register the interceptor in your Spring MVC configuration.

   ```java
   import org.springframework.beans.factory.annotation.Autowired;
   import org.springframework.context.annotation.Configuration;
   import org.springframework.web.servlet.config.annotation.InterceptorRegistry;
   import org.springframework.web.servlet.config.annotation.WebMvcConfigurer;

   @Configuration
   public class WebConfig implements WebMvcConfigurer {

       @Autowired
       private LanguageInterceptor languageInterceptor;

       @Override
       public void addInterceptors(InterceptorRegistry registry) {
           registry.addInterceptor(languageInterceptor);
       }
   }
   ```

4. **Access the Language in Your Beans:**

   Now, in any of your beans, you can access the current language using the `LanguageContextHolder`.

   ```java
   import org.springframework.stereotype.Service;

   @Service
   public class SomeService {
       public void someMethod() {
           String language = LanguageContextHolder.getLanguage();
           // Use the language as needed
       }
   }
   ```

This way, you avoid the need to pass the language parameter through all method calls manually. The language is stored in a `ThreadLocal` variable, making it accessible from any part of the code that runs within the same request context.

