To exclude an `id` property from a Lombok builder, you can use the `@Builder` and `@Builder.Default` annotations provided by the Lombok library. While `@Builder.Default` is typically used to set default values for fields, it can also be utilized in combination with custom setter methods to prevent the `id` property from being included in the builder.

Here's how you can achieve that:

1. Annotate your class with `@Builder`.
2. Use the `@Builder.Default` annotation on the `id` field.
3. Make the `id` field non-final and provide a custom setter method for setting the `id`.

Here's an example:

```java
import lombok.Builder;
import lombok.Getter;
import lombok.Setter;
import lombok.ToString;

@Getter
@Setter
@ToString
@Builder
public class MyEntity {
    private Long id;

    @Builder.Default
    private String name = "Default Name";

    public static class MyEntityBuilder {
        private Long id;

        // Remove the `id` field from the builder
        private MyEntityBuilder() {
        }

        // Custom method to set the `id` field
        public MyEntityBuilder name(String name) {
            this.name = name;
            return this;
        }
    }

    public static void main(String[] args) {
        MyEntity entity = MyEntity.builder()
                                  .name("Sample Name")
                                  .build();
        System.out.println(entity);
    }
}
```

In this example:

1. `@Builder` is at the class level to generate the builder for the class.
2. `id` is excluded from the builder by providing a custom `MyEntityBuilder` class that doesn't set `id` in the builder.
3. The `name` field can still be set through the builder.

This way, the `id` field will be excluded from the builder while other fields can still be configured. Note that the `id` field can still be set directly on the object itself if necessary.

