Yes, you can use the `@RequiredArgsConstructor` along with other Lombok annotations to achieve the exclusion of the `id` field from the builder. Lombok's `@Builder` has a way to exclude specific fields by combining with `@Builder.Default` and Lombok's builder customization features.

Here is an example of how to do this using `@AllArgsConstructor` and `@Builder`:

```java
import lombok.AllArgsConstructor;
import lombok.Builder;
import lombok.Getter;
import lombok.ToString;

@Getter
@ToString
@Builder
@AllArgsConstructor
public class MyEntity {
    private final Long id; // The id should be final to enforce immutability
    private final String name;
    private final String description;

    public static class MyEntityBuilder {
        private Long id; // Exclude id from builder

        // Override the build method to set the 'id'
        public MyEntity build() {
            return new MyEntity(null, this.name, this.description);
        }
    }

    public static void main(String[] args) {
        MyEntity entity = MyEntity.builder()
                                  .name("Sample Name")
                                  .description("Sample Description")
                                  .build();
        System.out.println(entity);
    }
}
```

In this example:
1. `@Getter`, `@ToString`, and `@Builder` annotations are used to simplify the class creation.
2. `@AllArgsConstructor` is utilized to generate a constructor for all fields.
3. A static inner `MyEntityBuilder` class is generated by Lombok and customized to exclude the `id` field.
4. The `build()` method is overridden in the `MyEntityBuilder` to ensure the `id` is set to `null` (or you could set it to another predefined value).

This way, the `id` field is effectively excluded from being set via the builder while `name` and `description` fields can still be set using the builder pattern.

