Certainly! When using `@Value` along with `@Builder` in Lombok, it's important to manage immutability while excluding a field such as `id` from the builder. Since `@Value` makes all fields final and provides a constructor for all fields, you need to customize the builder to handle the exclusion of `id`.

To achieve this, you can use a custom builder class. Here's an example:

```java
import lombok.Builder;
import lombok.Value;
import lombok.experimental.NonFinal;

@Value
@Builder
public class MyEntity {
    // Fields
    @NonFinal
    Long id; // Marking as @NonFinal to allow modification
    String name;
    String description;

    // Static inner builder class
    public static class MyEntityBuilder {
        private Long id; // This will exclude `id` from being set through the builder

        // Override the build method to ensure `id` is set to null
        public MyEntity build() {
            return new MyEntity(null, this.name, this.description);
        }
    }

    public static void main(String[] args) {
        // Usage of the builder excluding id
        MyEntity entity = MyEntity.builder()
                                  .name("Sample Name")
                                  .description("Sample Description")
                                  .build();
        System.out.println(entity); // Will display id as null
    }
}
```

In this example:
1. The class is annotated with `@Value` to make it immutable.
2. The `id` field is marked with `@NonFinal` to allow initialization through the constructor but exclude it from the builder.
3. The static inner `MyEntityBuilder` class is customized to exclude `id` and set it to `null` (or another value) in the `build()` method.

This way, the `id` field will be excluded from the builder, and you can still initialize `id` at the time of object creation using other mechanisms if needed.

