In Java, there is no direct method in the `LocalDate` class to convert `LocalDate` to `Year`. However, you can use the `Year::from` method, which is a clean and straightforward approach.

Here's how you can do it:

```java
import java.time.LocalDate;
import java.time.Year;

public class Main {
    public static void main(String[] args) {
        LocalDate localDate = LocalDate.of(2023, 10, 5); // example date
        Year year = Year.from(localDate);
        System.out.println("Year: " + year);
    }
}
```

Alternatively, you can extract the year from the `LocalDate` and then construct a `Year` object:

```java
import java.time.LocalDate;
import java.time.Year;

public class Main {
    public static void main(String[] args) {
        LocalDate localDate = LocalDate.of(2023, 10, 5); // example date
        int yearValue = localDate.getYear();
        Year year = Year.of(yearValue);
        System.out.println("Year: " + year);
    }
}
```

Both methods will give you the desired `Year` object from a `LocalDate`. The `Year::from` method is more concise and is recommended for this conversion.

