2. **Implementation in `VehicleEvaluationDataBuilder` Avoiding Object Casting:**

    By capturing the return type using a variable of type `Object` and then casting it, you can ensure type safety without using explicit object casts. This approach leverages type inference indirectly:

    ```java
    @Service
    @RequiredArgsConstructor
    @FieldDefaults(level = PRIVATE, makeFinal = true)
    @Validated
    public class VehicleEvaluationDataBuilder {
