            // Use methods with wildcard types
            Object result = foo.returnSomething();

            if (result != null) {
                Class<?> returnType = result.getClass(); // Capture the type of return value

                if (returnType.isInstance(result)) {
                    doSomethingWithFoo(foo, returnType.cast(result));
                }
            }

            // Existing method implementation
            // ...

            return new VehicleEvaluationData();
        }

        private <T> void doSomethingWithFoo(Foo<T> foo, T input) {
            // Now we have both Foo<T> and T without casting to Object
            foo.doSomething(input);
        }

