                }
            }

            // Existing method implementation
            // ...

            return new VehicleEvaluationData();
        }

        // Other methods...
    }
    ```

### Explanation

1. **Capture Type:** The call to `foo.returnSomething()` obtains a result of type `Object`, but you then use its `Class<?> returnType = result.getClass();` to capture its actual type.
2. **Generic Method:** The private method `<T> void doSomethingWithFoo(Foo<T> foo, T input)` takes a generic `Foo<T>` and an input of type `T`. By using `Class` reflections and a generic method, you avoid direct object casting and ensure type safety during interactions.
3. **Type Assertion:** The check using `returnType.isInstance(result)` ensures that you only cast when the object instance is of the expected type. The `returnType.cast(result)` is a safer way to use the type.

