- `cz.hc.dok.offers.repository.impl.contract.vehicle.request.VehicleRequestMapperImpl`
- `cz.hc.dok.offers.repository.impl.contract.mapper.VehicleRequestMapperImpl`

This kind of conflict generally occurs when multiple components are annotated with the same bean name, either explicitly via `@Component("beanName")` or implicitly by having the same class name (in case the class names are the same and Spring infers the bean name from the class name).

### Steps to resolve the issue

1. **Rename one of the beans**: Ensure that each bean has a unique name either by changing the class name or by explicitly specifying a unique name using the `@Component` annotation.

2. **Refactor Package Structure**: Ensure that beans with the same implementation intention reside in their correct packages to avoid conflicts.

3. **Conditional Beans**: If both beans are necessary and they should be conditionally loaded, you might consider adding conditions with `@Conditional`.

### Solution

